GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[$16022251]] -- - Heavy Infantry. Revered female members of the Inquisition from ages past.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[$16022252]] -- - Unique, independent squad, exclusively led by a Grey Knight Chaplain.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[$16022253]] -- - Best for fast-attack objectives, specialising in ranged combat.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16022254]] -- - They exchange low endurance for increased mobility; can independently use their Krak Grenades.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16022255]] -- - Although weak in melee combat, they sparingly and spontaneously cast devastating psychic attacks!
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16022256]] -- - Can upgrade their mastercraft bolters to either incinerators or psilencers.
